import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import EmployeeForm from './components/EmployeeForm';
import EmployeeList from './components/EmployeeList';
import Dashboard from './components/Dashboard';
import Login from './components/Login';

const App = () => {
  const [employees, setEmployees] = useState([
    { name: 'Shaik Hasna', position: 'Other', department: 'ai&ds' }
  ]);

  return (
    <Router>
      <div>
        <h1>Employee Management System</h1>
        <Routes>
          <Route
            path="/login"
            element={<Login />}
          />
          <Route
            path="/dashboard"
            element={<Dashboard />}
          />
          <Route
            path="/add-employee"
            element={<EmployeeForm employees={employees} setEmployees={setEmployees} />}
          />
          <Route
            path="/employee-list"
            element={<EmployeeList employees={employees} setEmployees={setEmployees} />}
          />
          <Route
            path="/"
            element={<div>Welcome to the Employee Management System</div>}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
